	append_script_to_head_of_page: function(head_script_value) {
		let _this = this;
		_this.data.elements.jquery_head_element.append(head_script_value);
	},
	script_validator: function(script_values) {

		let _this = this;

		script_values.forEach(script => {

			//CHECK IF script is allowed to run
			if(script.scriptKillSwitch) {
				return;
			}

			//Check if current page is equal to the page its allowed to run on
			if(script.shouldBeInHead) {
				//Check if script can run on current url 
				script.pageURLToFireOn.forEach(urlLinkPicker => {
					if(window.location.pathname.includes(urlLinkPicker.urlToRunOn)) {
						_this.append_script_to_head_of_page(script.scriptValue);
						return;
					}
				})
				//IF URL length 0 or less, then fire
				if(script.pageURLToFireOn.length <= 0 ) {
					_this.append_script_to_head_of_page(script.scriptValue);
					return;
				}

			//ELSE check URL if allowed to fire and fire
			} else {
				script.pageURLToFireOn.forEach(urlLinkPicker => {
					if(window.location.pathname.includes(urlLinkPicker.urlToRunOn)) {
						//fire script if allowed
						eval(script.scriptValue)
						return;
					}
				})
				//IF URL length 0 or less, then fire
				if(script.pageURLToFireOn.length <= 0 ) {
					eval(script.scriptValue)
					return;
				}
			}
		}) 

	},
